export default function Layout(props: any) {
  const unstated = StoreContainer.useContainer();

  return (
    <div>
      <BarCharts data={unstated.dataDiff} labels={unstated.labels} />
      <NavBar />
      <SideBar />
      <div className="main-panel">
        {/* <div className="content">
          <div className="row"> */}
        {props.children}
        {/* </div>
        </div> */}
        <Footer />
      </div>
    </div >
  )
}
